import React from "react";

function SideLogin() {
  const custom = {
    height: "100%",
    width: "40%",
    position: "absolute",
    right: "0%",
    backgroundColor: "black",
    opacity: "0.2",
  };
  return (
    <div className="container-fluid " style={custom}>
      <h1 className="text-center">Login</h1>
      <div class="form-floating mb-3">
        <input
          type="number"
          class="form-control"
          id="floatingInput"
          placeholder="Phone Number"
        />
      </div>
      <button type=" btn btn-light submit" style={{ backgroundColor: "#fc8019" }}>
        Login
      </button>
    </div>
  );
}

export default SideLogin;
